// Navbar.jsx
import React from 'react';
import { Link } from 'react-router-dom'; // Importamos Link desde react-router-dom para manejar la navegación

const Navbar = () => {
  return (
    <nav>
      <ul>
        <li><Link to="/all-todos-ids">Lista de todos los pendientes (solo IDs)</Link></li>
        <li><Link to="/all-todos-titles">Lista de todos los pendientes (IDs y Titles)</Link></li>
        <li><Link to="/unresolved-todos">Lista de todos los pendientes sin resolver (ID y Title)</Link></li>
        <li><Link to="/resolved-todos">Lista de todos los pendientes resueltos (ID y Title)</Link></li>
        <li><Link to="/all-todos-userids">Lista de todos los pendientes (IDs y User IDs)</Link></li>
        <li><Link to="/resolved-todos-userids">Lista de todos los pendientes resueltos (ID y User ID)</Link></li>
        <li><Link to="/unresolved-todos-userids">Lista de todos los pendientes sin resolver (ID y User ID)</Link></li>
      </ul>
    </nav>
  );
};

export default Navbar;
